import React from 'react';
import Form from 'antd/lib/form/Form';
import { Input } from 'antd';

const Searchbar = () => {
	return (
		<div className='gi_width_res'>
			<Form>
				<Input placeholder='Search...' />
			</Form>
		</div>
	);
};

export default Searchbar;
